import React from 'react';
import './producerDashboard.css';

const ProducerDashboard = () => {
  return (
    <div className="producer-dashboard">
      {/* Cabeçalho com saudação */}
      <header className="dashboard-header">
        <h1>Boa noite, Produtor!</h1>
        <p>Já publicou seu evento?</p>
      </header>

      {/* Painel de navegação */}
      <section className="action-section">
        <div className="action-box">
          <h2>Criar Evento</h2>
          <button className="action-button">Criar Evento Presencial</button>
          <button className="action-button">Criar Evento Online</button>
          <button className="action-button">Criar Conteúdo Digital</button>
        </div>
        <div className="action-box">
          <h2>Meus Conteúdos</h2>
          <button className="action-button">Meus Eventos</button>
          <button className="action-button">Meus Conteúdos</button>
        </div>
      </section>

      {/* Mensagem de primeira vez */}
      <section className="first-time-section">
        <p>Publique um evento pela primeira vez!</p>
        <p>
          Você tem total autonomia para cadastrar, gerenciar e acompanhar todas as informações de seu evento.
        </p>
      </section>

      {/* Seção de ajuda */}
      <section className="help-section">
        <p>Precisa de ajuda para criar?</p>
        <button className="help-button">Obter Ajuda</button>
      </section>
    </div>
  );
}

export default ProducerDashboard;
